import React from "react";
import { Container, Box, Text } from "@chakra-ui/react";

const Home = () => {
  return (
    <Container maxW="xl" centerContent>
      <Box
        bg="gray"
        justifyContent="center"
        p={2}
        borderRadius="md"
        m="5% 5% 5% 5%"
        w="100%"
      >
        <Text
          color="white"
          fontSize="3xl"
          justifyContent="center"
          p="0 30% 0 0"
        >
          Coder-Talks
        </Text>
      </Box>
      <Box></Box>
    </Container>
  );
};

export default Home;
